UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'FXR' THEN 0.5760000000000001 WHEN 'PFFV' THEN 0.557 WHEN 'GOOY' THEN 1.444 WHEN 'GMF' THEN 4.997 WHEN 'BITU' THEN 2.585 WHEN 'IQDF' THEN 1.714 WHEN 'SPEM' THEN 2.141 WHEN 'JULD' THEN 1.936 WHEN 'BNDC' THEN 0.322 WHEN 'CGGO' THEN 0.517 WHEN 'BULD' THEN 0.06999999999999999 WHEN 'RYU' THEN 1.71041 WHEN 'FYC' THEN 0.717 WHEN 'GCAL' THEN 0.488 WHEN 'VBK' THEN 1.4989999999999999 WHEN 'PAB' THEN 0.5760000000000001 WHEN 'XHYI' THEN 0.842 WHEN 'BEEZ' THEN 0.246 WHEN 'RODM' THEN 2.343 WHEN 'EUDV' THEN 0.8069999999999999
    END,
    updatedat = NOW()
    WHERE symbol IN ('FXR', 'PFFV', 'GOOY', 'GMF', 'BITU', 'IQDF', 'SPEM', 'JULD', 'BNDC', 'CGGO', 'BULD', 'RYU', 'FYC', 'GCAL', 'VBK', 'PAB', 'XHYI', 'BEEZ', 'RODM', 'EUDV');